import React from "react";
import DeleteIcon from '@material-ui/icons/Delete';


const List=(props)=>{
    return(
    <div className="todo_style">
        <span onClick={cutit}
        ><DeleteIcon className="deleteIcon"/></span>
     <li style={{textDecoration:"line-through"}}>{props.text}</li>


     </div>


    );
};






export default List
